				$key6 = TbprofessorsituacaoPeer::getPrimaryKeyHashFromRow($row, $startcol6);
				if ($key6 !== null) {
					$obj6 = TbprofessorsituacaoPeer::getInstanceFromPool($key6);
					if (!$obj6) {
	
						$cls = TbprofessorsituacaoPeer::getOMClass(false);

					$obj6 = new $cls();
					$obj6->hydrate($row, $startcol6);
					TbprofessorsituacaoPeer::addInstanceToPool($obj6, $key6);
				} // if $obj6 already loaded

				// Add the $obj1 (Tbprofessor) to the collection in $obj6 (Tbprofessorsituacao)
				$obj6->addTbprofessor($obj1);

			} // if joined row is not null

			$results[] = $obj1;
		}
		$stmt->closeCursor();
		return $results;
	}

